import { View, useEffect } from "react";

const LoginScreen = ({navigation}) => {
    useEffect(() => {
        navigation.setOptions({
            headerStyle: {
                backgroundColor: 'darkslateblue',
            },
            headerTitleStyle: {
                color: 'white'
            },
            headerTitleAlign: 'center'
        })

        
    }, [])

    return (
        <></>
    );
}

export default LoginScreen;
